import React from 'react';
import { Link } from 'react-router-dom';
import '../Styles/HomePage.css';

const HomePage = () => (
  <main className="home-container">
    <h1 className="home-title">Welcome to Open Source Project Finder</h1>
    <p className="home-desc">
      Discover open-source projects that match your skills, interests, and favorite technologies.<br />
      Search, filter, and get smart recommendations for your next contribution!
    </p>
    <Link to="/search" className="home-link" aria-label="Start searching open source projects">
      Start Searching
    </Link>
  </main>
);

export default HomePage;
